import React from 'react'
import PropTypes from 'prop-types'
import Item from './Item'
import './CartPage.css'

export default function CartPage({items}) {
    return (
        <ul className='CartPage-items'>
            {items.map(item => 
                <li className="CartPage-item"
                     key={item.id}>
                    <Item item={item}>
                        </Item>
                </li> )}
            
        </ul>
    )
}

CartPage.propTypes = {
    items : PropTypes.array.isRequired,
}
